(10, 34, 'Naoto', 'f1iyl30s@mail.com', 'http://www.facebook.com/profile.php?id=100003469602624', '190.37.142.103', '2015-05-28 22:25:58', '2015-05-29 02:25:58', 'I was tempted the first few days cause I rieeazld I could have loaded up on a lot more yummmmmy stuff the first 2 days and didn''t. Visions of a lucious coconut cake were dancing in my head. However, what helped me to resist was to remind myself of the little I lost so far, how badly I wanted to reach my goal and also it really helped a lot to watch testimonial videos and peoples video journeys on the hcg diet. Seeing other people''s success what an inspiration and motivation to tough it out during momentary temptation and just to get my mind on somethingelse meanwhile til it passed. Hope that helps some!', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:35.0) Gecko/20100101 Firefox/35.0', '', 0, 0),
(11, 624, 'Roque', 'o9b7xt08fdt@gmail.com', 'http://www.facebook.com/profile.php?id=100003469768824', '52.25.111.152', '2015-05-28 23:57:28', '2015-05-29 03:57:28', 'that he thought it was the fuennist thing.But with more than 400 40mm cannon and 100 105mm howitzer rounds on target, and more than 200 of the enemy killed, Black quickly was dubbed the  angel of death  by her Afghan counterparts.Black said the Afghan general dialed into the Taliban frequency and told the enemy,  America is so determined, they bring their women to kill the Taliban. It is the  angel of death'' raining fire upon you. For her actions, Black was one of six Airmen to receive the first Air Force Combat Action Medal in a ceremony in front of the Air Force Memorial in Washington. She was the first Air Force woman to receive a combat medal.Then Air Force Chief of Staff Gen. T. Michael Moseley, spoke of Black and her fellow recipients:  The medal ties the Airmen of today engaged with enemy hostiles to the legacy of courage, valor service and sacrifice that our predecessors left us. These Airmen, like all Airmen, stand on the shoulders of giants like Billy Mitchell, Arnold, Chennault, Doolittle, Lemay and Schriever.  He concluded by saying,  Today we recognize these six amazing Airmen for their combat roles as warriors wielding the air power bequeathed to us by these giants. Following the ceremony, Black told the audience,  It''s a great honor anytime you''re recognized for your efforts, but I don''t look at it as heroic. I''m proud to represent all of the Airmen who will receive this award. Since that day in 2001 that established Black''s legacy, she has become a master navigator with more than 1,500 flying hours and 540 combat hours during Operation Enduring Freedom.During a recent CNN interview with Black, concerning the president''s announcement to open all military career fields to women, she commented that,  I think it  there''s going to be the standard and the standard needs to remain the same. You need to be physically, mentally and technically capable to do whatever job it is. And if you can meet those standards, bring it. You know, gender aside, we have to prepare our forces for the future fight. And it''s dynamic. It''s evolving, everchanging. So introducing women into those key roles will be  might be that critical punch we need to deliver to the future enemy. An example that the Afghan general back in 2001 predicted for women of his own country:  Look at what America allows their women to do.FORT MEADE, Md. (AFNS)  It was less than 90 days after Sept. 11, 2001, and nerves were still raw. Capt. Allison Black had landed in Uzbekistan just hours earlier and was headed towards her first combat mission in Afghanistan. A C130H gunship navigator assigned to the 1st Special Operations Group, her assignment was to plot routes, communicate with ground forces and identify targets in the darkness below.Bearded special forces soldiers were traveling on horseback armed with intelligence gained from Afghan Northern Alliance soldiers and Black and her crew were there to use high caliber rounds to create a problem for the Taliban.The gunship had begun to take antiaircraft fire from the Taliban, even though they had initially destroyed a bank of rocket launchers and several enemy trucks. With help from the Northern Alliance, and their general, Abdul Rashid Dostum, they identified a nearby safehouse hiding more than 200 Taliban and al Qaida soldiers.As they approached their target, Black''s voice shattered the silence over the special forces soldiers'' field radios. The Northern Alliance general was in disbelief when he heard a woman''s voice over the radio:  A woman, sent to kill the Taliban.  Black said that he thought it was the fuennist thing.But with more than 400 40mm cannon and 100 105mm howitzer rounds on target, and more than 200 of the enemy killed, Black quickly was dubbed the  angel of death  by her Afghan counterparts.Black said the Afghan general dialed into the Taliban frequency and told the enemy,  America is so determined, they bring their women to kill the Taliban. It is the  angel of death'' raining fire upon you. For her actions, Black was one of six Airmen to receive the first Air Force Combat Action Medal in a ceremony in front of the Air Force Memorial in Washington. She was the first Air Force woman to receive a combat medal.Then Air Force Chief of Staff Gen. T. Michael Moseley, spoke of Black and her fellow recipients:  The medal ties the Airmen of today engaged with enemy hostiles to the legacy of courage, valor service and sacrifice that our predecessors left us. These Airmen, like all Airmen, stand on the shoulders of giants like Billy Mitchell, Arnold, Chennault, Doolittle, Lemay and Schriever.  He concluded by saying,  Today we recognize these six amazing Airmen for their combat roles as warriors wielding the air power bequeathed to us by these giants. Following the ceremony, Black told the audience,  It''s a great honor anytime you''re recognized for your efforts, but I don''t look at it as heroic. I''m proud to represent all of the Airmen who will receive this award. Since that day in 2001 that established Black''s legacy, she has become a master navigator with more than 1,500 flying hours and 540 combat hours during Operation Enduring Freedom.During a recent CNN interview with Black, concerning the president''s announcement to open all military career fields to women, she commented that,  I think it  there''s going to be the standard and the standard needs to remain the same. You need to be physically, mentally and technically capable to do whatever job it is. And if you can meet those standards, bring it. You know, gender aside, we have to prepare our forces for the future fight. And it''s dynamic. It''s evolving, everchanging. So introducing women into those key roles will be  might be that critical punch we need to deliver to the future enemy. An example that the Afghan general back in 2001 predicted for women of his own country:  Look at what America allows their women to do. One day our country will have similar freedoms.', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:35.0) Gecko/20100101 Firefox/35.0', '', 0, 0),
